import "./HeroimgStyles.css";

import React from 'react';

import IntroImg from "../assets/img8.jpg";

import { Link } from "react-router-dom";

const Heroimg = () => {
  return (
    <div className="hero">
        <div className="mask">
            <img className="intro-img" 
            src={IntroImg}
            />
        </div>
        <div className="content">
            <h1>WELCOME TO RAHOVEC</h1>
            <p>EXPLORE THE CITY OF WINERY</p>
            <div>
                <Link to="/thingstodo" className="btn">Things to Do</Link>
                <Link to="/thingstodo" className="btn-light">Things to Do</Link>
            </div>


        </div>
    </div>
  )
}

export default Heroimg
